import React from 'react'
import { Container ,Title} from './style'
const Contirubut = () => {
    return (
        <Container>
           <Title>Become a contributor?</Title>
           <Desc>Join us and get tips & tricks to become a great Designer and Developer</Desc>
           
        </Container>
    )
}

export default Contirubut
